  [],\n\t\"revision_timestamp\": \"2016-10-25T19:03:51.038445\",\n\t\"name\": \"environmental-assessment-bear-river-migratory-bird-refuge-hunt-plan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Environmental Assessment (EA) is designed
  to evaluate possible actions for modifying the Bear River Migratory Bird Refuge
  (Refuge) public hunt plan. The hunt plan needs complete review to ensure an adequate
  acreage is open to hunting, that open areas provide appropriate quality of hunting,
  and sanctuary areas provide enough protection for birds. After careful consideration,
  all of the issues and concerns from public scoping sessions were summarized to create
  9 objectives. The 9 objectives are to: 1) Provide high quality hunting, 2) Minimize
  conflicts with other uses, 3) Provide remote hunting areas, 4) Provide areas open
  to airboats, 5) Facilitate hunting access, 6) Facilitate law enforcement, 7) Minimize
  disturbance to swans, 8) Minimize disturbance to rest areas, and 9) Protect breeding
  populations. This document is focused on public hunting and the development of a
  Hunting Plan designating areas open to hunting and associated regulations on Bear
  River Migratory Bird Refuge.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
